import { createStackNavigator } from "@react-navigation/stack";
import React from "react";

import AppDrawer from '../components/appDrawer/AppDrawer';
import Agendar from '../screens/agendar/Agendar'; // Verifique se o caminho está correto

const Stack = createStackNavigator();

/**
 * Este Stack Navigator agrupa as telas que devem ter a animação padrão
 * e as que devem ter animação de modal.
 */
export default function AppStack() {
  return (
    <Stack.Navigator screenOptions={{ headerShown: false }}>
      {/* Telas normais */}
      <Stack.Screen
        name="AppDrawer"
        component={AppDrawer}
      />

      {/* Tela com animação de Modal */}
      <Stack.Screen
        name="Agendar"
        component={Agendar}
        options={{
          presentation: 'modal', // <-- É esta linha que faz a tela subir
        }}
      />
    </Stack.Navigator>
  );
}
